import { useNavigate } from "react-router-dom";
import CreateTodo from "../components/CreateTodo";
import GetTodos from "../components/GetTodos";

function Todo({ token }) {
  const navigate = useNavigate();

  if (!token) navigate("/");
  return (
    <>
      <h1>Todo</h1>
      <CreateTodo />
      <GetTodos />
    </>
  );
}

export default Todo;
